PendingTransactionFilter() // { id: &quot;0x345a6572337856574a76364e457a4366&quot;, type: &#39;transaction&#39; }</code></td></tr><tr><td><code>__namedParameters.publicClient.estimateContractGas</code></td><td>&lt;<code>chain</code>, <code>abi</code>, <code>functionName</code>, <code>args</code>&gt;(<code>args</code>) =&gt; <code>Promise</code>&lt;<code>bigint</code>&gt;</td><td>Estimates the gas required to successfully execute a contract write function call. - Docs: <a href="https://viem.sh/docs/contract/estimateContractGas" target="_blank" rel="noreferrer">https://viem.sh/docs/contract/estimateContractGas</a> <strong>Remarks</strong> Internally, uses a <a href="https://viem.sh/docs/clients/public" target="_blank" rel="noreferrer">Public Client</a> to call the <a href="https://viem.sh/docs/actions/public/estimateGas" target="_blank" rel="noreferrer"><code>estimateGas</code> action</a> with <a href="https://viem.sh/docs/contract/encodeFunctionData" target="_blank" rel="noreferrer">ABI-encoded <code>data</code></a>. <strong>Example</strong> <code>import { createPublicClient, http, parseAbi } from &#39;viem&#39; import { mainnet } from &#39;viem/chains&#39; const client = createPublicClient({ chain: mainnet, transport: http(), }) const gas = await client.estimateContractGas({ address: &#39;0xFBA3912Ca04dd458c843e2EE08967fC04f3579c2&#39;, abi: parseAbi([&#39;function mint() public&#39;]), functionName: &#39;mint&#39;, account: &#39;0xf39fd6e51aad88f6f4ce6ab8827279cfffb92266&#39;, })</code></td></tr><tr><td><code>__namedParameters.publicClient.estimateFeesPerGas</code></td><td>&lt;<code>chainOverride</code>, <code>type</code>&gt;(<code>args?</code>) =&gt; <code>Promise</code>&lt;<code>EstimateFeesPerGasReturnType</code>&lt;<code>type</code>&gt;&gt;</td><td>Returns an estimate for the fees per gas for a transaction to be included in the next block. - Docs: <a href="https://viem.sh/docs/actions/public/estimateFeesPerGas" target="_blank" rel="noreferrer">https://viem.sh/docs/actions/public/estimateFeesPerGas</a> <strong>Example</strong> <code>import { createPublicClient, http } from &#39;viem&#39; import { mainnet } from &#39;viem/chains&#39; const client = createPublicClient({ chain: mainnet, transport: http(), }) const maxPriorityFeePerGas = await client.estimateFeesPerGas() // { maxFeePerGas: ..., maxPriorityFeePerGas: ... }</code></td></tr><tr><td><code>__namedParameters.publicClient.estimateGas</code></td><td>(<code>args</code>) =&gt; <code>Promise</code>&lt;<code>bigint</code>&gt;</td><td>Estimates the gas necessary to complete a transaction without submitting it to the network. - Docs: <a href="https://viem.sh/docs/actions/public/estimateGas" target="_blank" rel="noreferrer">https://viem.sh/docs/actions/public/estimateGas</a> - JSON-RPC Methods: <a href="https://ethereum.org/en/developers/docs/apis/json-rpc/#eth_estimategas" target="_blank" rel="noreferrer"><code>eth_estimateGas</code></a> <strong>Example</strong> <code>import { createPublicClient, http, parseEther } from &#39;viem&#39; import { mainnet } from &#39;viem/chains&#39; const client = createPublicClient({ chain: mainnet, transport: http(), }) const gasEstimate = await client.estimateGas({ account: &#39;0xA0Cf798816D4b9b9866b5330EEa46a18382f251e&#39;, to: &#39;0x70997970c51812dc3a010c7d01b50e0d17dc79c8&#39;, value: parseEther(&#39;1&#39;), })</code></td></tr><tr><td><code>__namedParameters.publicClient.estimateMaxPriorityFeePerGas</code></td><td>&lt;<code>chainOverride</code>&gt;(<code>args?</code>) =&gt; <code>Promise</code>&lt;<code>bigint</code>&gt;</td><td>Returns an estimate for the max priority fee per gas (in wei) for a transaction to be included in the next block. - Docs: <a href="https://viem.sh/docs/actions/public/estimateMaxPriorityFeePerGas" target="_blank" rel="noreferrer">https://viem.sh/docs/actions/public/estimateMaxPriorityFeePerGas</a> <strong>Example</strong> <code>import { createPublicClient, http } from &#39;viem&#39; import { mainnet } from &#39;viem/chains&#39; const client = createPublicClient({ chain: mainnet, transport: http(), }) const maxPriorityFeePerGas = await client.estimateMaxPriorityFeePerGas() // 10000000n</code></td></tr><tr><td><code>__namedParameters.publicClient.experimental_blockTag?</code></td><td><code>BlockTag</code></td><td>Default block tag to use for RPC requests.</td></tr><tr><td><code>__namedParameters.publicClient.extend</code></td><td>&lt;<code>client</code>&gt;(<code>fn</code>) =&gt; <code>Client</code>&lt;<code>Transport</code>, <code>Chain</code> | <code>undefined</code>, <code>undefined</code>, <code>PublicRpcSchema</code>, { [K in string | number | symbol]: client[K] } &amp; <code>PublicActions</code>&lt;<code>Transport</code>, <code>Chain</code> | <code>undefined</code>&gt;&gt;</td><td>-</td></tr><tr><td><code>__namedParameters.publicClient.fillTransaction</code></td><td>&lt;<code>chainOverride</code>, <code>accountOverride</code>&gt;(<code>args</code>) =&gt; <code>Promise</code>&lt;<code>FillTransactionReturnType</code>&lt;<code>Chain</code> | <code>undefined</code>, <code>chainOverride</code>&gt;&gt;</td><td>Fills a transaction request with the necessary fields to be signed over. - Docs: <a href="https://viem.sh/docs/actions/public/fillTransaction" target="_blank" rel="noreferrer">https://viem.sh/docs/actions/public/fillTransaction</a> <strong>Example</strong> <code>import { createPublicClient, http } from &#39;viem&#39; import { mainnet } from &#39;viem/chains&#39; const client = createPublicClient({ chain: mainnet, transport: http(), }) const result = await client.fillTransaction({ account: &#39;0xA0Cf798816D4b9b9866b5330EEa46a18382f251e&#39;, to: &#39;0x70997970c51812dc3a010c7d01b50e0d17dc79c8&#39;, value: parseEther(&#39;1&#39;), })</code></td></tr><tr><td><code>__namedParameters.publicClient.getBalance</code></td><td>(<code>args</code>) =&gt; <code>Promise</code>&lt;<code>bigint</code>&gt;</td><td>Returns the balance of an address in wei. - Docs: <a href="https://viem.sh/docs/actions/public/getBalance" target="_blank" rel="noreferrer">https://viem.sh/docs/actions/public/getBalance</a> - JSON-RPC Methods: <a href="https://ethereum.org/en/developers/docs/apis/json-rpc/#eth_getbalance" target="_blank" rel="noreferrer"><code>eth_getBalance</code></a> <strong>Remarks</strong> You can convert the balance to ether units with <a href="https://viem.sh/docs/utilities/formatEther" target="_blank" rel="noreferrer"><code>formatEther</code></a>. <code>const balance = await getBalance(client, { address: &#39;0xA0Cf798816D4b9b9866b5330EEa46a18382f251e&#39;, blockTag: &#39;safe&#39; }) const balanceAsEther = formatEther(balance) // &quot;6.942&quot;</code> <strong>Example</strong> <code>import { createPublicClient, http } from &#39;viem&#39; import { mainnet } from &#39;viem/chains&#39; const client = createPublicClient({ chain: mainnet, transport: http(), }) const balance = await client.getBalance({ address: &#39;0xA0Cf798816D4b9b9866b5330EEa46a18382f251e&#39;, }) // 10000000000000000000000n (wei)</code></td></tr><tr><td><code>__namedParameters.publicClient.getBlobBaseFee</code></td><td>() =&gt; <code>Promise</code>&lt;<code>bigint</code>&gt;</td><td>Returns the base fee per blob gas in wei. - Docs: <a href="https://viem.sh/docs/actions/public/getBlobBaseFee" target="_blank" rel="noreferrer">https://viem.sh/docs/actions/public/getBlobBaseFee</a> - JSON-RPC Methods: <a href="https://ethereum.org/en/developers/docs/apis/json-rpc/#eth_blobBaseFee" target="_blank" rel="noreferrer"><code>eth_blobBaseFee</code></a> <strong>Example</strong> <code>import { createPublicClient, http } from &#39;viem&#39; import { mainnet } from &#39;viem/chains&#39; import { getBlobBaseFee } from &#39;viem/public&#39; const client = createPublicClient({ chain: mainnet, transport: http(), }) const blobBaseFee = await client.getBlobBaseFee()</code></td></tr><tr><td><code>__namedParameters.publicClient.getBlock</code></td><td>&lt;<code>includeTransactions</code>, <code>